import Todos from './components/Todos';
import Todo from './models/models';

function App() {
  const todos = [
    new Todo('learn react'),
    new Todo('lear typescript')
  ]

  return (
    <div>
      <Todos items={todos}/>
    </div>
  );
}

export default App;
